import './App.css';
import Navbar from 'component/navbar'
import { Route } from 'react-router-dom'
import Home from 'pages/home'
function App() {
  return (
    <div className="App">
      <Route path='/home' component={Home}></Route>
      <Navbar />
    </div>
  );
}

export default App;
